import React, { PureComponent } from "react";
import "./ViewProfile.css";

class EditProfile extends PureComponent {
  constructor(props) {
    super();
    this.state = {
      contactNo: ""
    };
    /*this.handleChange = handleChange.bind(this);*/
  }

  render() {
    /*const userInfo = this.props.user.userInfo;*/
    return (
      <div>
        <form
          className="edit-profile"
          /* onSubmit={e => {
            e.preventDefault();
            this.props.changeIsEdit();
            this.props.updateUser(this.state);
          }}*/
        >
          <table className="table table-striped animated fadeIn">
            <tbody>
              <tr>
                <td>Daiict Id </td>
                <td> {/*this.props.user.daiictId*/} </td>
              </tr>
              <tr>
                <td> First Name</td>
                <td>
                  {" "}
                  {/*userInfo.user_first_name
                    ? userInfo.user_first_name
                  : ""*/}{" "}
                </td>
              </tr>
              <tr>
                <td> Last Name</td>
                <td>
                  {" "}
                  {/*userInfo.user_last_name ? userInfo.user_last_name : ""*/}{" "}
                </td>
              </tr>
              <tr>
                <td>Primary Email</td>
                <td>{/*this.props.user.primaryEmail*/}</td>
              </tr>
              <tr>
                <td> Contact No </td>
                <td>
                  <input
                    type="text"
                    value="1010101010"
                    name="contactNo"
                    required="true"
                    pattern="[0-9]{10}"
                  />
                </td>
              </tr>
              <tr>
                <td> Gender</td>
                <td> {/*userInfo.user_sex*/} </td>
              </tr>
              <tr>
                <td> Programme</td>
                <td> {/*userInfo.user_programme*/} </td>
              </tr>
            </tbody>
          </table>
          <input
            type="submit"
            className="btn btn-outline-success style-btn"
            value="Save"
          />
        </form>
      </div>
    );
  }
}

export default EditProfile;
